INSERT IGNORE INTO characters (id_character,age,history,img,name,weight) VALUES (1,25,'Buzz Lightyear es un personaje principal de la franquicia Toy Story. Es un superhéroe de juguete y una figura de acción en la franquicia. Junto con su amigo, el sheriff Woody, es uno de los dos personajes principales de las cuatro películas de Toy Story.',,'Buzz Lightyear',0.98);
INSERT IGNORE INTO characters (id_character,age,history,img,name,weight) VALUES (2,90,'Es la eterna novia de Mickey Mouse y junto a él debutó en Plane Crazy, el 15 de mayo de 1928, aunque alcanzó el éxito junto a Mickey en el tercer episodio de ambos, Steamboat Willie',,'Minnie Mouse',20.2);
INSERT IGNORE INTO characters (id_character,age,history,img,name,weight) VALUES (3,23,'John Clayton III hijo de una pareja britanica que tuvo que abandonar a su hijo en la selva africana luego del motin del siglo XX, luego de muertos sus padres, john fue adoptado por monos.',,'Tarzan',70.0);
INSERT IGNORE INTO characters (id_character,age,history,img,name,weight) VALUES (4,14,'Ella una joven princesa que su belleza es definida por su amabilidad y pureza. Poco despues de encontrar el amor en un encantador principe, Blancanieves se entera de que su celosa madrastra, La Reina Malvada, esta determinada a matarla',,'Blancanieves',56.0);